business? Go here: https://skool.com/games \n\nIf you’re new to my channel, my name is Alex Hormozi. I’m the founder and managing partner of Acquisition.com. It’s a family office, which is just a formal way of saying we invest our own money into companies. Our 10 portfolio companies bring in over $200,000,000+ per year. Our ownership stake varies between 20% and 100% of them. Given this is a YT channel, and anyone can claim anything, I’ll give you some stuff you can google to verify below.\n\nHow I got here…\n\n21: Graduated Vanderbilt in 3 years Magna Cum Laude, and took a fancy consulting job.\n23 yrs old: Left my fancy consulting job to start a business (a gym).\n24 yrs old: Opened 5 gym locations.\n26 yrs old: Closed down 6th gym. Lost everything. \n26 yrs old: Got back to launching gyms (launched 33). Then, lost everything for a 2nd time. \n26 yrs old: In desperation, started licensing model as a hail mary. It worked. \n27 yrs old: \"Gym Launch\" does $3M profit the next 6 months. Then $17M profit next 12 months.\n28 yrs old: Started Prestige Labs. $20M the first year.  \n29 yrs old: Launched ALAN, a software company for agencies to work leads for customers. Scaled to $1.7mmo within 6 months. \n31 yrs old: Sold 75% of UseAlan to a strategic buyer in an all stock deal. \n31 yrs old: Sold 66% of Gym Launch \u0026 Prestige Labs at $46.2M valuation in all-cash deal to American Pacific Group. (you can google it)\n31 yrs old: Started our family office Acquisition.com. We invest and scale companies using the $42M in distributions we had taken + the cash from the $46.2M exit.\n32 yrs old: Started making free content showing how we grow companies to make real business education accessible to everyone (and) to attract business owners to invest or scale their businesses. \n34 yrs old: I became co-owner of https://Skool.com to help the many people who want to start a business online do so.\n\nToday: Our portfolio now does $200M/yr between 10 companies. The largest doing $100M/yr the smallest doing $5M per year. Our ownership varies between 20% and 100% ownership of the companies. Many of them we invested in early and helped grow (which is how we make our money - not youtube videos).\n\nTo all the gladiators in the arena, we’re all in the middle of writing our own stories. The worse the monsters, the more epic the story.\n\nYou either get an epic outcome or an epic story. Both mean you win. \n\nKeep crushing. May your desires be greater than your obstacles. \n\nNever quit,\n\nAlex\n\nFULL DISCLOSURE \nI make content to make money - just - on a longer time horizon than most. I want to build trust with business owners so we can find the best ones and help them scale. And if they’re awesome, write them a check and go all the way as partners.","commandRuns":[{"startIndex":38,"length":23,"onTap":{"innertubeCommand":{"clickTrackingParams":"COkBEM2rARgBIhMIgpT6l8mIjwMVSsc_BB2HGhicSOn4huK829XIDg==","commandMetadata":{"webCommandMetadata":{"url":"https://www.youtube.com/redirect?event=video_description\u0026redir_token=QUFFLUhqa3pQWnpuSUdNNThvVDZCX29Ua3o4R1kyZi1vUXxBQ3Jtc0tuZXc5QzNGeklzV2kyZTMzV1I0OFlsMXB4T1R0aVFUZExYZVFfMFUzTm9WSVRiTEpPLVRHNEM0RGVXSGdnb2ZrVTE5YW5YVTUzSTMxdGVYUFhtN20zRTZaTGJZQU9oZVVWV2VDRF84em9USlZDcWRYWQ\u0026q=https%3A%2F%2Facquisition.com%2F\u0026v=DpFW28xBvGk","webPageType":"WEB_PAGE_TYPE_UNKNOWN","rootVe":83769}},"urlEndpoint":{"url":"https://www.youtube.com/redirect?event=video_description\u0026redir_token=QUFFLUhqa3pQWnpuSUdNNThvVDZCX29Ua3o4R1kyZi1vUXxBQ3Jtc0tuZXc5QzNGeklzV2kyZTMzV1I0OFlsMXB4T1R0aVFUZExYZVFfMFUzTm9WSVRiTEpPLVRHNEM0RGVXSGdnb2ZrVTE5YW5YVTUzSTMxdGVYUFhtN20zRTZaTGJZQU9oZVVWV2VDRF84em9USlZDcWRYWQ\u0026q=https%3A%2F%2Facquisition.com%2F\u0026v=DpFW28xBvGk","target":"TARGET_NEW_WINDOW","nofollow":true}}}},{"startIndex":98,"length":23,"onTap":{"innertubeCommand":{"clickTrackingParams":"COkBEM2rARgBIhMIgpT6l8mIjwMVSsc_BB2HGhicSOn4huK829XIDg==","commandMetadata":{"webCommandMetadata":{"url":"https://www.youtube.c f Acquisition.com. It’s a family office, which is just a formal way of saying we invest our own money into companies. Our 10 portfolio companies bring in over $200,000,000+ per year. Our ownership stake varies between 20% and 100% of them. Given this is a YT channel, and anyone can claim anything, I’ll give you some stuff you can google to verify below.\n\nHow I got here…\n\n21: Graduated Vanderbilt in 3 years Magna Cum Laude, and took a fancy consulting job.\n23 yrs old: Left my fancy consulting job to start a business (a gym).\n24 yrs old: Opened 5 gym locations.\n26 yrs old: Closed down 6th gym. Lost everything. \n26 yrs old: Got back to launching gyms (launched 33). Then, lost everything for a 2nd time. \n26 yrs old: In desperation, started licensing model as a hail mary. It worked. \n27 yrs old: \"Gym Launch\" does $3M profit the next 6 months. Then $17M profit next 12 months.\n28 yrs old: Started Prestige Labs. $20M the first year.  \n29 yrs old: Launched ALAN, a software company for agencies to work leads for customers. Scaled to $1.7mmo within 6 months. \n31 yrs old: Sold 75% of UseAlan to a strategic buyer in an all stock deal. \n31 yrs old: Sold 66% of Gym Launch \u0026 Prestige Labs at $46.2M valuation in all-cash deal to American Pacific Group. (you can google it)\n31 yrs old: Started our family office Acquisition.com. We invest and scale companies using the $42M in distributions we had taken + the cash from the $46.2M exit.\n32 yrs old: Started making free content showing how we grow companies to make real business education accessible to everyone (and) to attract business owners to invest or scale their businesses. \n34 yrs old: I became co-owner of https://Skool.com to help the many people who want to start a business online do so.\n\nToday: Our portfolio now does $200M/yr between 10 companies. The largest doing $100M/yr the smallest doing $5M per year. Our ownership varies between 20% and 100% ownership of the companies. Many of them we invested in early and helped grow (which is how we make our money - not youtube videos).\n\nTo all the gladiators in the arena, we’re all in the middle of writing our own stories. The worse the monsters, the more epic the story.\n\nYou either get an epic outcome or an epic story. Both mean you win. \n\nKeep crushing. May your desires be greater than your obstacles. \n\nNever quit,\n\nAlex\n\nFULL DISCLOSURE \nI make content to make money - just - on a longer time horizon than most. I want to build trust with business owners so we can find the best ones and help them scale. And if they’re awesome, write them a check and go all the way as partners.","commandRuns":[{"startIndex":38,"length":23,"onTap":{"innertubeCommand":{"clickTrackingParams":"CBMQ040EGAUiEwiClPqXyYiPAxVKxz8EHYcaGJxI6fiG4rzb1cgO","commandMetadata":{"webCommandMetadata":{"url":"https://www.youtube.com/redirect?event=video_description\u0026redir_token=QUFFLUhqbmd5a3BLWjVlUkVzcUF6d1JqQnRmNURqeGw1Z3xBQ3Jtc0tuOFczdkJFWkUtV2dCNklUT1hpbWZ0UE9OZ2taZFhMX2w0eDZnUWphNnpnajNTWVlxNGVhQzdKTVJmX2NBajRjTmp1RzdKZ2o2VHFvQU11ekZVUmJGd25McVl0cHlsZ1VzUHdqcUlfeXEyYVZ2TTFxdw\u0026q=https%3A%2F%2Facquisition.com%2F\u0026v=DpFW28xBvGk","webPageType":"WEB_PAGE_TYPE_UNKNOWN","rootVe":83769}},"urlEndpoint":{"url":"https://www.youtube.com/redirect?event=video_description\u0026redir_token=QUFFLUhqbmd5a3BLWjVlUkVzcUF6d1JqQnRmNURqeGw1Z3xBQ3Jtc0tuOFczdkJFWkUtV2dCNklUT1hpbWZ0UE9OZ2taZFhMX2w0eDZnUWphNnpnajNTWVlxNGVhQzdKTVJmX2NBajRjTmp1RzdKZ2o2VHFvQU11ekZVUmJGd25McVl0cHlsZ1VzUHdqcUlfeXEyYVZ2TTFxdw\u0026q=https%3A%2F%2Facquisition.com%2F\u0026v=DpFW28xBvGk","target":"TARGET_NEW_WINDOW","nofollow":true}}}},{"startIndex":98,"length":23,"onTap":{"innertubeCommand":{"clickTrackingParams":"CBMQ040EGAUiEwiClPqXyYiPAxVKxz8EHYcaGJxI6fiG4rzb1cgO","commandMetadata":{"webCommandMetadata":{"url":"https://www.youtube.com/redirect?event=video_description\u0026redir_token=QUFFLUhqbkY0c0lyaXkxc3dlVTh2aXNhQmFSNFNFb3BkQXxBQ3Jtc0ttQmxQVWV0bzk2S0dpOHprRUdQTHNVVkRTRElVbn
